import React from 'react';
import DataPractice from '../dataPractice.json';

export default class Practice extends React.Component {
    state = {
      page: 1, 
      data: DataPractice
    } 


      render() {

        return (
        <> 
        <div className="div">{this.state.data[this.state.page].id}</div>
        <div className="div">{this.state.data[this.state.page].question}</div>
        <span>Previous</span>  
        <span>Next</span>        
        </>
        )


    }

  }
